  "Allegations" : "WITHOUT ADMITTING OR DENYING THE FINDINGS, TELLEZ CONSENTED TO THE SANCTIONS AND TO THE ENTRY OF FINDINGS THAT HE FAILED TO IMPLEMENT HIS MEMBER FIRM'S ANTI-MONEY LAUNDERING COMPLIANCE PROGRAM (AMLCP) AND FAILED TO REPORT ACCOUNT ACTIVITY AND OTHER SIMILAR ACTIVITY IN ACCOUNTS TO THE FIRM'S AML PRINCIPAL AS REQUIRED BY THE FIRM'S AMLCP. THE FINDINGS STATED THAT TELLEZ FAILED TO REPORT CERTAIN AML RED FLAGS INDICATIVE OF POTENTIALLY SUSPICIOUS ACTIVITY, AS IDENTIFIED WITHIN THE FIRM'S AMLCP, WHICH WERE EXHIBITED IN VARIOUS CUSTOMER ACCOUNTS INVOLVING POTENTIALLY SUSPICIOUS LIQUIDATIONS OF VENEZUELAN SOVEREIGN AND STATE-SPONSORED BONDS.  THE MAJORITY OF THE ACCOUNTS EXHIBITED A PATTERN OF RECEIVING VENEZUELAN BONDS, AFTER WHICH THE BONDS WERE SOLD IN A SHORT PERIOD OF TIME, FOLLOWED BY DISBURSEMENT OF THE SALE PROCEEDS BY OUTGOING WIRE TRANSFERS, CHECKS AND ATM WITHDRAWALS WITHOUT RE-INVESTMENT. CERTAIN OF THE ACCOUNTS ENGAGED IN EXTENSIVE MONEY MOVEMENTS AFTER THE LIQUIDATION OF VENEZUELAN BONDS WITHOUT ANY FURTHER CORRESPONDING SECURITIES ACTIVITY, WHICH OFTEN TIMES EXCEEDED THE ACCOUNT HOLDERS' STATED NET WORTH AND ANNUAL INCOME. OTHER ACCOUNTS SOLELY ENGAGED IN EXTENSIVE MONEY MOVEMENTS WITHOUT ANY CORRESPONDING SECURITIES OR BOND LIQUIDATION ACTIVITY, WHICH EXCEEDED THE ACCOUNT HOLDERS' STATED NET WORTH AND ANNUAL INCOME. IN ADDITION TO BEING AWARE OF ACTIVITY THAT WAS INCONSISTENT WITH THE FOREIGN EXCHANGE MARKET PROCESS, TELLEZ ALSO ATTEMPTED TO ASSIST A CUSTOMER OPEN ADDITIONAL ACCOUNTS TO CIRCUMVENT THOSE RESTRICTIONS.",
